import React, { Component } from 'react'

//Material UI
import Accordion from '@material-ui/core/Accordion';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

class privacyPolicy extends Component {
    state = { //initiate state variables
        expanded: null,
    }
    render() {
        const handleChange = (panel) => (event, isExpanded) => { //handle expanded panel open/close
            this.setState({
                expanded: isExpanded ? panel : false
            })
        };
        return (
            <div className="privacyPolicy">
                <Accordion expanded={this.state.expanded === 'complaint'} onChange={handleChange('complaint')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="complaint-content"
                        id="complaint-header"
                    >
                        <Typography>Complaints</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                        If you have complaints regarding the way your protected health information was handled, you may submit a complaint in writing to our office. You will not be retaliated against in any manner for a complaint.
                        </Typography>
                    </AccordionDetails>
                </Accordion>
                {/* Complaint */}
                <Accordion expanded={this.state.expanded === 'complaint'} onChange={handleChange('complaint')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="complaint-content"
                        id="complaint-header"
                    >
                        <Typography>Complaints</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                        If you have complaints regarding the way your protected health information was handled, you may submit a complaint in writing to our office. You will not be retaliated against in any manner for a complaint.
                        </Typography>
                    </AccordionDetails>
                </Accordion>
            </div>
        )
    }
}

export default privacyPolicy
